import React, { useState } from 'react';
import { View, Text, TextInput, Button, Alert, Picker, StyleSheet } from 'react-native';
import axios from 'axios';
import Icon from 'react-native-vector-icons/FontAwesome';

export default function BookingScreen({ route }) {
  const { hotel } = route.params;
  const [selectedCheckInDate, setSelectedCheckInDate] = useState('');
  const [selectedCheckOutDate, setSelectedCheckOutDate] = useState('');
  const [selectedNumGuests, setSelectedNumGuests] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [address, setAddress] = useState('');
  const [email, setEmail] = useState('');
  const [numMen, setNumMen] = useState('');
  const [numWomen, setNumWomen] = useState('');
  const [numChildren, setNumChildren] = useState('');

  // ... (other state variables)

  const serverUrl = 'https://akinbrand.com.ng/mywi-fi/';

  const handleBooking = async () => {
    try {
      // Construct the booking data
      const bookingData = {
        hotelId: hotel.id,
        checkInDate: selectedCheckInDate,
        checkOutDate: selectedCheckOutDate,
        numGuests: selectedNumGuests,
        phoneNumber,
        address,
        email,
        numMen,
        numWomen,
        numChildren,
        // ... (other data)
      };

      // Send a POST request to the server
      const response = await axios.post(`${serverUrl}booking.php`, bookingData);

      if (response.data.message === 'Booking Successful') {
        Alert.alert('Booking Successful', 'Your booking has been confirmed.');
      } else {
        Alert.alert('Booking Error', 'An error occurred while booking. Please try again.');
      }
    } catch (error) {
      Alert.alert('Booking Error', 'An error occurred while booking. Please try again.');
      console.error(error);
    }
  };

  return (
    <View style={styles.container}>
      <Text style={styles.header}>Make a Booking</Text>
      <Text style={styles.hotelName}>{hotel.name}</Text>
      <View style={styles.selectOption}>
        <Icon name="calendar" size={20} style={styles.icon} />
        <Picker
          selectedValue={selectedCheckInDate}
          onValueChange={(itemValue) => setSelectedCheckInDate(itemValue)}
        >
          <Picker.Item label="Select Check-In Date" value="" />
          <Picker.Item label="Option 1" value="option1" />
          <Picker.Item label="Option 2" value="option2" />
          {/* Add more date options as needed */}
        </Picker>
      </View>
      <View style={styles.selectOption}>
        <Icon name="calendar" size={20} style={styles.icon} />
        <Picker
          selectedValue={selectedCheckOutDate}
          onValueChange={(itemValue) => setSelectedCheckOutDate(itemValue)}
        >
          <Picker.Item label="Select Check-Out Date" value="" />
          <Picker.Item label="Option 1" value="option1" />
          <Picker.Item label="Option 2" value="option2" />
          {/* Add more date options as needed */}
        </Picker>
      </View>
      <View style={styles.selectOption}>
        <Icon name="users" size={20} style={styles.icon} />
        <Picker
          selectedValue={selectedNumGuests}
          onValueChange={(itemValue) => setSelectedNumGuests(itemValue)}
        >
          <Picker.Item label="Select Number of Guests" value="" />
          <Picker.Item label="1" value="1" />
          <Picker.Item label="2" value="2" />
          {/* Add more number of guests options as needed */}
        </Picker>
      </View>
      {/* ... (other input components) */}
      <Button title="Book Now" onPress={handleBooking} />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  header: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 20,
  },
  hotelName: {
    fontSize: 18,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  selectOption: {
    flexDirection: 'row',
    alignItems: 'center',
    width: '80%',
    height: 40,
    borderColor: 'gray',
    borderWidth: 1,
    margin: 10,
  },
  icon: {
    marginRight: 10,
  },
});
